import React from "react";
import "./Nombre.scss";

const Nombre=({setNombre, setEdad, setPeso})=>{
 return(
     <div className="contenedor-nombre">
         <div className="imagen"></div>
         <ul>
         <li><input type="text" placeholder="Nombre"
         onChange={e => setNombre(e.target.value)}/></li>
         <li><input type="text" placeholder="Edad"
         onChange={e => setEdad(e.target.value)}/></li>
         <li><input type="text" placeholder="Peso"
         onChange={e => setPeso(e.target.value)}/></li>
         <li><button>Agregar</button></li>
         </ul>
     </div>
 )
}

export default Nombre;
